import ChartData from './chartData'

const chart = () => {
  const data = { chartData:
  {
    labels:['b','c','d','e'],
    datasets:[{
      label:'population',
      data:[ 3, 4, 5 , 6],
      backgroundColor:[
        'rgba(255,99,132,0.6)',
        'rgba(54,162,235,0.6)',
        'rgba(255,206,86,0.6)',
        'rgba(75,192,192,0.6)'
      ]
    }],
  }}

  return (
    <div>
      <ChartData data={data} />
    </div>
  )
}

export default chart
